import { json } from "body-parser";
import React from "react";
import {useState, useEffect} from "react";

function Todo(){

    const [data, setData]= useState([])
    const item=[];
    const apiGet = ()=>{
        fetch('http://localhost:1337/api/notice')
        .then((response)=>response.json())
        .then((json)=>{
            for(let i=0;i<json.user.length;i=i+1){
                item.push(json.user[i].notice);
                console.log(json.user[i].name);
            }
            setData(json);
        })
    }

    useEffect(()=>{
        apiGet();  
    },[])

    var namesList = item.map(function(name){
        return <li>{name}</li>;
      })

    return (

        <div>

            <h1>Hi</h1>
            <h2>NOTICE</h2>
            <ul>{namesList}</ul>
        </div>
    )
}

export default Todo

